import { useState } from "react";
import { Link } from "react-router-dom";
import { RESPONSE } from "../App";
import "./styles.css";

export const Sushi = () => {

  type SUSHIDATA = {
    id:string
    longitude:string
    latitude:string
    type:string
    tunaId:string
  };

  const [producerData, setProducerData] = useState<SUSHIDATA | null>(null);

  const [response, setResponse] = useState<RESPONSE | undefined>(undefined);

  const handleData = async () => {
    console.log(producerData)
    const _tx = await fetch('http://localhost:5000/api/addSushi',{
      method:'POST',
      body:JSON.stringify(producerData),
      headers: {
        'Content-Type': 'application/json',
        'Connection': 'keep-alive',
        'Accept': '*/*',
    },
    });
    setResponse(await _tx.json());
  };

  return (
    <div>
      <h1>Sushi</h1>
      <div className="form">
        <input
          name="id"
          type="text"
          className="feedback-input"
          placeholder="Processed ID"
        />
        <input
          name="latitude"
          type="text"
          className="feedback-input"
          placeholder="Latitiude"
        />
        <input
          name="longitude"
          type="text"
          className="feedback-input"
          placeholder="Longitude"
        />
        <input
          name="type"
          type="text"
          className="feedback-input"
          placeholder="Type"
        />
        <input
          name="tunaId"
          type="text"
          className="feedback-input"
          placeholder="TunaID"
        />
        <button onClick={handleData}>ADD</button>
      </div>

      <Link to="/">Home</Link>
    </div>
  );
};
